import React from "react";
import "./Blank_project.css";
import create_back from "../assets/create_back.svg";

function Blank_project() {
    return (
        <div>
            <div
                className="back"
                onClick={() => {
                    history.goBack();
                }}
            >
                <img src={create_back} alt="" height="14" width="14.97" />
            </div>
        </div>
    );
}

export default Blank_project;
